INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(2, 1, 'Harry Potter and the Chamber of Secrets', 'Harijev letnji raspust uključuje najgoru proslavu rođendana koja se može zamisliti, zloslutna predskazanja kućnog vilenjaka Dobija i beg od Darslijevih s Ronom Vizlijem u letećem automobilu! Vrativši se u Hogvorts, gde će pohađati drugi razred, Hari počinje da čuje šapate koji se pronose kroz hodnike škole. A onda počinju napadi… Nakon što su neke od uče.', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(3, 1, 'Harry Potter and the Prisoner of Azkaban ', 'Kad se Noćni viteški autobus pojavi iz tame i uz škripu guma zaustavi pred njim, za Harija Potera počinje još jedna potpuno „neobična“ avantura u Hogvortsu, školi za veštičarenjae i čarobnjaštvao. Sirijus Blek, ozloglašeni masovni ubica i podanik Lorda Voldemora, nalazi se u bekstvu, a ljudi pričaju da sada dolazi po Harija. Tokom prvog časa iz predskazivanja profesorka Treloni vidi predznake smrti u Harijevom čaju.', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(4, 1, 'Harry Potter and the Goblet of Fire', 'Trocarobnjacki turnir se približava i samo učenici stariji od sedamnaest godina mogu da se takmiče. To ne sprečava Harija Potera da sanja o pobedi. A onda – Vatreni pehar, koji odabira učesnike turnira, obznanjuje i Harijevo ime. Na takmičenju će se Hari suočiti sa smrtonosnim zadacima, zmajevima i Mračnim čarobnjacima. Da li će uz pomoć svojih prijatelja Rona i Hermione uspeti da završi turnir – i ostane živ?', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(5, 1, 'Harry Potter and the Order of the Phoenix', 'Nakon što su dementori napali njegovog rođaka Dadlija, Hari Poter zna da Voldemor neće prezati ni od čega ne bi li ga pronašao. Malo je onih koji bi da stanu na put Mračnom gospodaru, ali Hari ipak nije usamljen u tom cilju: u Ulici Grimold okuplja se tajni red kako bi se borio protiv snaga zla. Hari mora da dozvoli profesoru Snejpu da ga poduči kako da se odbrani od Voldemorovih bespoštednih napada na njegov um.', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(6, 1, 'Harry Potter and the Half-Blood Prince', '„Bio je tu, viseći na nebu iznad škole: plamteća zelena lobanja sa zmijskim jezikom, beleg koji bi Smrtožderi ostavili za sobom kad god bi ušli u neku zgradu... kad god bi nekoga ubili...“.Kada se jedne letnje večeri Dambldor pojavio u Šimširovoj ulici, ruka kojom koristi magični štapić bila je usahla i pocrnela. Ali on nije objasnio Hariju šta je posredi. Tajne i sumnje šire se čarobnjačkim svetom poput šumskog požara, a čak i sam Hogvorts nije više bezbedno utočište. Hari je ubeđen da Melfoj nosi Mračni znak.', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(7, 1, 'Harry Potter and the Deathly Hallows', 'Sedajući u prikolicu Hagridovog motora i napustivši Šimširovu ulicu poslednji put, Hari Poter zna da Voldemor i Smrtožderi nisu daleko za njim. Čini koje su ga do sada štitile su razvejane, a on ne može više da se skriva. Mračni gospodar uvlači strah u kosti svima do kojih je Hariju stalo i, kako bi ga zaustavio, Hari mora da pronađe i uništi preostale Horkrukse.\r\n', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(8, 1, 'Harry Potter and the Cursed Child', 'Osma priča...\r\nDevetnaest godina kasnije...\r\nBiti Hari Poter, nikada nije bilo lako. Nije lako ni sada kada je Hari izrastao u prezauzetog službenika Ministarstva magije, u supruga i oca troje maloljetne djece.\r\nDok se Hari rve sa prošlošću koja odbija da ostane tamo gdje joj je mjesto, njegov najmlađi sin Albus mora da se suoči sa balastom porodičnog nasljeđa za koji nije nikada želio. ', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(9, 3, 'Hobit ', '\"Bilbo Bagins je prvi hobit iz Okruga koji je postao slavan, i svojim delima utro put svom narodu za čuveni poduhvat Družine Prstena. Veliki čarobnjak Gandalf predložio ga je kao saputnika Torinu i Patuljcima u velikoj avanturi preotimanja blaga od Zmaja – Šmauga Veličanstvenog – zbog Bilbovih izuzetnih sposobnosti i provalničkih veština, kao i umešnosti u opasnosti, koju po njegovom izgledu možda niko ne bi ni naslutio...\r\n', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(10, 3, 'Družina prstena ', 'Kada ekscentrični Hobit Bilbo Bagins na oproštajnoj zabavi povodom svog 111. rođendana iznenada i naočigled zaprepašćenih gostiju volšebno nestane, u idiličnom Okrugu pokrenuće se lanac događaja koji će uzdrmati čitav Srednji svet i odrediti njegovu sudbinu. Bilbo je, naime, odlučio da ostatak života provede u vilovnjačkom carstvu Rivendal, i svu svoju imovinu ostavio je mladom rođaku Frodu Baginsu, uključujući i tajanstveni prsten koji njegovog nosioca čini nevidljivim. ', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(11, 3, 'Dve kule ', 'Družina Prstena je na svom pohodu prošla razna iskušenja i na kraju se raspala - Gandalf je u borbi s demonom Balrogom nestao u utrobi zemlje, Boromir je najpre podlegao mračnoj moći Prstena a zatim poginuo u napadu Orka, dok su Pipin i Veseli oteti. Frodo, nakon što se uverio koliko mračna moć Prstena utiče na svakoga ko dođe u dodir s njim, odlučuje da put u Mordor nastavi sâm. Ipak, verni Sem ga ne napušta.\r\n', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(12, 3, 'Povratak kralja', 'Iako poražene u prvoj velikoj bici Rata za Prsten, armije Mračnog Gospodara sve su moćnije i spremaju se na pohod na Minas Tirit, prestonicu Gondora, najmoćnijeg kraljevstva Ljudi. Pad Gondora značio bi i trijumf Zla i kraj Srednjeg sveta. Dok Ljudi, Patuljci i Vilovnjaci ujedinjuju snage u odbrani „belog grada” Minis Tirita, Frodo i Sem nastavljaju svoj tegoban put u Mordor.', 1, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(13, 3, 'Silmalirion', 'Priče iz Silmariliona govore o najstarijoj istoriji Srednjeg sveta, temeljima Tolkinove mitologije i događajima koji prethode onima opisanim u Gospodaru prstenova. Dž.R.R. Tolkin je čitavog života radio na ovoj knjizi, ali je nije završio. Knjigu je 1977, četiri godine nakon Tolkinove smrti, na osnovu rukopisa i skica iz ostavštine dopunio i za štampu priredio njegov sin Kristofer.\r\n', 1, ),
(14, 5, 'Ana Karenjina', 'Ana Karenjina je kultna priča o ljubavi i preljubi, koja se odvija u miljeu visokog društva Moskve i Sankt Peterburga. Bogato i složeno remek-delo prikazuje zlokoban tok ljubavne afere između Ane, prelepe udate žene, i grofa Vronskog, bogatog vojnog oficira. Tolstoj prepliće živote desetine likova i na taj način oslikava rusko društvo u poznom XIX veku.', 2, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(15, 5, 'Rat i mir', 'Rat i mir je neprevaziđeni klasik u kojem Tolstoj daje sliku ruskog društva u Napoleonovo doba i prati živote tri glavna junaka: Pjera Bezuhova, nezakonitog sina seoskog kneza, koji neočekivano dobija pozamašno nasledstvo i titulu; kneza Andreja Bolkonskog, koji napušta porodicu da bi se borio u ratu protiv Napoleona; i Nataše Rostove, prelepe i čarobne devojke koja za Tolstoja oličenje savršene žene.\r\n', 3, ),
(16, 4, 'Zločin i kazna ', 'Roman Braća Karamazovi Fjodora Dostojevskog po mišljenju mnogih kritičara i proučavalaca njegovog dela smatra se krunom autorove spisateljske karijere. Priča o porodici Karamazov Dostojevskom je poslužila kao okosnica za izuzetan filozofski roman koji istražuje hrišćansku etiku, slobodnu volju, otuđenost, suparništvo i moral.', 3, ),
(17, 4, 'Braća Karamazovi', 'Roman Braća Karamazovi Fjodora Dostojevskog po mišljenju mnogih kritičara i proučavalaca njegovog dela smatra se krunom autorove spisateljske karijere. Priča o porodici Karamazov Dostojevskom je poslužila kao okosnica za izuzetan filozofski roman koji istražuje hrišćansku etiku, slobodnu volju, otuđenost, suparništvo i moral.', 3, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(18, 4, 'Zapisi iz podzemlja', 'Jedno od \"najuzbudljivijih saznanja\" koja se nameću čitaocu ove knjige svakako će biti saznanje da je pisac nekom svojom čudnom psihološkom alhemijom uspeo da prodre u najintimnije kutke njegove ličnosti i izloži ih nemilosrdno svetlosti spoznaje.Čitanje ove knjige ljubiteljima klasične literature doneće pored ostalog \"zadovoljstvo i uzbuđenje daleko veće od čitanja nekog napetog književnog trilera, jer će u likovima i situacijama iz knjige prepoznati ljude i događaje iz svog ili bilo čijeg okruženja, iz svoje ili bilo čije sadašnjosti, prošlosti i neminovno budućnosti.\"', 4, ),
(19, 6, 'Na Drini Ćuprija', 'Ovaj rado čitan i širom sveta prevođen roman, zapravo je slikovita višegradska hronika kroz vremena i vekove, kroz carstva, kulture i prilike oko kojih se pletu sudbine mnogovrsnih likova koji su oličenje okolnosti u kojima žive, navika, nasleđa i običaja kojima duguju i život sam. Smaragdnozelena Drina i most koji odoleva iskušenjima i stradanjima, i koji je jedini protagonista u ovom kaleidoskopu epizodnih likova, simboli su vanvremenskih vrednosti i lepote koja i u najtežim vremenima i neizvesnostima uvek pronađe svoj put ka opstanku.', 4, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(20, 6, 'Travnička hronika', 'Ovo je roman o sudaru civilizacijski odeljenih svetova, o položaju stranih konzula u zatvorenoj i neprijateljski nastrojenoj bosanskoj kasabi kojoj dolazak sličnih funkcionera nikada nije doneo nikakvo dobro. Dotičući se, u pojedinim epizodnim povestima, sudbine Sefarda, raje i lokalnog stanovništva, Andrić daje živu ilustraciju travničkog društvenog ambijenta s početka XIX veka, zasnivajući svoje ostvarenje na izuzetnoj dokumentarnoj građi koja pripovestima daje pečat verodostojnosti.', 4, );
INSERT INTO `knjige` (`idknjige`, `autor`, `naziv`, `opis`, `zanr`, `naslovnica`) VALUES
(21, 1, 'Harry Potter and the Sorcerers Stone', 'Hari Poter još nije bio ni čuo za Hogvorts kad su sove počele da bacaju pisma na otirač pred vratima broja četiri u Šimširovoj ulici. Pisma, adresirana zelenim mastilom na Harija, ispisana na pergamentu i zapečaćena ljubičastim voskom, sakrili su nepročitana njegovi grozni tetka i teča. Ali na dan Harijevog jedanaestog rođendana poludžin po imenu Hagrid pojavljuje se s neverovatnim novostima: Hari Poter je čarobnjak i primljen je u Hogvorts, školu za veštičarenje i čarobnjaštvo. Neverovatna pustolovina samo što nije počela!', 1, );

